% % run the clear-sky detection routine.
% csd = LongAckerman2000CSD(ghi,dif,zen,1); %plot figure set to 1 so an output is plotted
%

function csd = LongAckerman2000CSD(ghi,dif,zen,LST,plot_figure)
%% safety checks
if ~iscolumn(ghi)
    ghi = ghi';
    if ~iscolumn(ghi)
        error('var ghi must be a column vector')
    end
end
if ~iscolumn(dif)
    dif = dif';
    if ~iscolumn(dif)
        error('var dif must be a column vector')
    end
end
if ~iscolumn(zen)
    zen = zen';
    if ~iscolumn(zen)
        error('var zen must be a column vector')
    end
end
if length(unique([length(ghi),length(dif),length(zen),length(datenum(LST))]))~=1
    error('vars must be equal in length')
end

%% begin
csd = zeros(size(ghi));
%% normalised total shortwave magnitude test
%fd is the downwelling total shortwave
%fn is the normalised total shortwave
% b is a constant. 
b=1.2;
ghin = ghi./cosd(zen).^b;
csd(ghin>1250)=1;
csd(ghin<1000 & zen<78.5)=1;
csd(ghin<900 & zen>78.5)=1;
%% maximum diffuse shortwave test
dmax = 150;
dlim = dmax.*cosd(zen).^0.5;
csd(dif>dlim)=1;

%% change in magnitude with time test
s = 1365;
%fdt is the top of atmosphere downwelling short wave irradiance.
fdt = s.*cosd(zen);

dfdt = fdt(1:end-1)-fdt(2:end);
dfdt = [NaN;dfdt];
dghi = ghi(1:end-1)-ghi(2:end);
dghi = [NaN;dghi];
% subjective constant based on clear-sky system noise (observed in the data
% being processed), and the absolute value of the change in measured
% shortwave dfdt must fall within the range. In an example, a subjective
% 2wm-2 was used and so is used here.
C = 2; 
ft_max = abs(dfdt) + C.*cosd(zen);

% find the unique days in the time series
days = floor(datenum(LST));
unique_days = unique(days);
% pre allocate solar noon
solar_noon = zeros(size(ghi));
% loop through each unique day
for i = 1:length(unique_days)
    % find the indices that correspond to this unique day
    idx = find(days==unique_days(i));
    % find the minimum zenith this day, e.g. solar noon.
    solar_noon(idx) = min(zen(idx));
end

ft_min  = abs(dfdt) - (cosd(solar_noon)+0.1)./cosd(zen);
% figure(1)
% hold on
% plot(abs(dfdt))
% plot(ft_min)
% plot(ft_max)
% hold off
% legend('dfdt','min','max')
% ylim([0 10])

% apply the filter
csd(abs(dghi)>ft_max)=1;
csd(abs(dghi)<ft_min)=1;

%% normalised diffuse ratio variability test
difn = dif./cosd(zen).^b;

% 11 minute period standard deviation with a detection limit of 0.0012.
str ='[';
for i = 1:11
    str = [str,'difn(',num2str(i),':end-',num2str(11-i),')'];
    if i<11
        str = [str,','];
    end
end
str = [str,'];'];
difn11 =eval(str);
dif_std = [NaN(5,1);std(difn11,0,2,'omitnan');NaN(5,1)]';

%Cannot remotely get close to sdt dev of 0.0012 as suggested by the paper.
%a value of 5 looks decent though.
csd(dif_std>5)=1;

% figure(1)
% hold on
% plot(difn)
% plot(dif_std)
% hold off
% ylim([0 400])
% xlim([1,5000])


%% figure
if exist('plot_figure','var')
    figure('name','Long and Ackerman CSD example','color','w');
    hold on
    plot(ghi)
    CSD = ghi;
    CSD(csd==1)=NaN;
    plot(CSD,'linewidth',2,'color','k')
    hold off    
    legend('GHI','Clear detected')
    ylabel('Irradiance [Wm^{-2}]')  
    set(gca,'xtick',[]);
    xlabel('Time')
end
end